import "./app.css";
import Home from "./pages/Home";
import Recipe from "./pages/Recipe";
import SingleRecipe from "./pages/SingleRecipe";
import ErrorPage from "./pages/ErrorPage";

function App() {
  return (
    <div className="App">
      <Home />
      <Recipe />
      <SingleRecipe />
      <ErrorPage />
    </div>
  );
}

export default App;
